DROP TABLE IF EXISTS `com_commodity`;
CREATE TABLE `com_commodity` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `category_code` varchar(16) DEFAULT NULL COMMENT '商品品类',
  `category_name` varchar(16) DEFAULT NULL COMMENT '品类名称',
  `brand_name` varchar(16) DEFAULT NULL COMMENT '品牌名称',
  `code` varchar(40) DEFAULT NULL COMMENT '商品编码',
  `bar_code` varchar(32) NOT NULL COMMENT '商品条码',
  `name` varchar(255) NOT NULL COMMENT '商品名称',
  `description` varchar(255) DEFAULT NULL COMMENT '商品简介',
  `unit` varchar(16) DEFAULT NULL COMMENT '计量单位',
  `packing_unit` varchar(8) DEFAULT NULL COMMENT '包装单位',
  `packing_specification` varchar(8) DEFAULT NULL COMMENT '包装规格',
  `suggested_retail_price` int(11) DEFAULT '0' COMMENT '建议零售价',
  `supply_price` int(11) DEFAULT '0' COMMENT '供货价',
  `cost_price` int(11) DEFAULT '0' COMMENT '成本价',
  `supplier_name` varchar(255) DEFAULT NULL COMMENT '供应商',
  `valid_period` varchar(16) DEFAULT NULL COMMENT '保质期',
  `portrait` varchar(128) DEFAULT NULL COMMENT '主图地址',
  `unit_specification` varchar(16) DEFAULT NULL COMMENT '规格',
  `pool_code` varchar(16) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `code` (`code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5481 DEFAULT CHARSET=utf8;

